import React, { Component } from "react";
import Talent from "./Talent";
import uuidv4 from "uuid/v4";

export default class TalentRow extends Component {
  render() {
    return (
      <div className="container">
        <div className="row justify-content-start">
          <div className="col-sm-2">
            <h2>Level {this.props.talentTiers[0]}</h2>
          </div>
          {this.props.randomHero.talents[1].map(talent => (
            <div className="col-sm-2">
              <Talent
                key={uuidv4()}
                talent={talent.icon}
                randomHero={this.props.randomHero}
              />
            </div>
          ))}
        </div>

        <div className="row justify-content-start">
          <div className="col-sm-2">
            <h2>Level {this.props.talentTiers[1]}</h2>
          </div>
          {this.props.randomHero.talents[4].map(talent => (
            <div className="col-sm-2">
              <Talent
                key={uuidv4()}
                talent={talent.icon}
                randomHero={this.props.randomHero}
              />
            </div>
          ))}
        </div>

        <div className="row justify-content-start">
          <div className="col-sm-2">
            <h2>Level {this.props.talentTiers[2]}</h2>
          </div>
          {this.props.randomHero.talents[7].map(talent => (
            <div className="col-sm-2">
              <Talent
                key={uuidv4()}
                talent={talent.icon}
                randomHero={this.props.randomHero}
              />
            </div>
          ))}
        </div>

        <div className="row justify-content-start">
          <div className="col-sm-2">
            <h2>Level {this.props.talentTiers[3]}</h2>
          </div>
          {this.props.randomHero.talents[10].map(talent => (
            <div className="col-sm-2">
              <Talent
                key={uuidv4()}
                talent={talent.icon}
                randomHero={this.props.randomHero}
              />
            </div>
          ))}
        </div>

        <div className="row justify-content-start">
          <div className="col-sm-2">
            <h2>Level {this.props.talentTiers[4]}</h2>
          </div>
          {this.props.randomHero.talents[13].map(talent => (
            <div className="col-sm-2">
              <Talent
                key={uuidv4()}
                talent={talent.icon}
                randomHero={this.props.randomHero}
              />
            </div>
          ))}
        </div>

        <div className="row justify-content-start">
          <div className="col-sm-2">
            <h2>Level {this.props.talentTiers[5]}</h2>
          </div>
          {this.props.randomHero.talents[16].map(talent => (
            <div className="col-sm-2">
              <Talent
                key={uuidv4()}
                talent={talent.icon}
                randomHero={this.props.randomHero}
              />
            </div>
          ))}
        </div>

        <div className="row justify-content-start">
          <div className="col-sm-2">
            <h2>Level {this.props.talentTiers[6]}</h2>
          </div>
          {this.props.randomHero.talents[20].map(talent => (
            <div className="col-sm-2">
              <Talent
                key={uuidv4()}
                talent={talent.icon}
                randomHero={this.props.randomHero}
              />
            </div>
          ))}
        </div>
      </div>
    );
  }
}
